            "15": "\n<div>\n<ol>\n\t<li>a:&nbsp; Hebrew unit equal to about 252 grains troy.<br />\n\tb: a unit of value based on a&nbsp;<b>shekel</b>&nbsp;weight of gold or silver.<br />\n\tA&nbsp;<b>shekel</b>&nbsp;was first a unit of weight-very roughly 11 grams (0.39 oz)<br />\n\t<br />\n\t<a href=\"https://www.translatorscafe.com/unit-converter/en-US/mass/58-50/denarius (Biblical Roman)-shekel (Biblical Hebrew)/\">1 denarius (Biblical Roman) = 0.337719298245614 shekel (Biblical Hebrew)&nbsp;</a><br />\n\t&nbsp;</li>\n\t<li>&quot;So when the merchants came by, his brothers pulled&nbsp;<b>Joseph</b>&nbsp;up out of the cistern and&nbsp;<b>sold</b>&nbsp;him for twenty shekels of silver to the Ishmaelites, who took him to Egypt.&quot; Note: A shekel is 14 grams of silver. (Gen&nbsp;37:12-36)</li>\n\t<li>Both Abraham and Ephron are rich but differ the faith.</li>\n</ol>\n</div>\n",
