            "20": "\n<div>&nbsp;</div>\n\n<div>Sarah:</div>\n\n<div>A. Delima:</div>\n\n<div>1. Age&nbsp;<br />\n2. Incest marriage.&nbsp;&nbsp;<br />\nCharater of Sarah</div>\n\n<ol>\n\t<li>obedience. &quot;Sarah obeyed Abraham, calling him lord. &quot; (1Pe3:6 ESV) The first good family model - wife obey husband and&nbsp;husband obey God.</li>\n\t<li>&nbsp;</li>\n\t<li>&nbsp;</li>\n\t<li>&nbsp;</li>\n\t<li>Abraham bought the land of cannon. It seems that it&nbsp;is a simple and boring story. But why it takes 18 verses to record it? Gen is about the origin of the world and whole human history. Each single word is precious and important.&nbsp;</li>\n\t<li>God promised Abraham that I will give your land to your offsprings. (Gen12:7). But God did not tell him how.&nbsp;</li>\n\t<li>What is the blessing of God? How people misunderstand the blessing of God.&nbsp;</li>\n\t<li>Abraham&#39;s important question: O the Lord, How can I know that I will gain the possession of it? (Gen 15:8)</li>\n\t<li>Abraham is richer than Ephron, because God was with him. But Abraham buy the land until wife died. why did not he buy early?&nbsp;</li>\n</ol>\n"
