            "3": "<ol><li>Who are Canaanite women?  Gen9:18, Gen9:25, Gen9:26, Gen10:6</li><li>Why not marry with? (A) health/height/weight/fat, wealth, intellectual, friendly/enemy, language, ethnic identity, beauty,  (B) cursed by (C) mission of Abraham (D) promised son (E) mission of God, Jesus. </li><li>How important? 3 degrees: most devoted, private, high. </li><li>Then, Why didn’t Abraham go for it himself? (A) old/unhealth.  (B) hometown disgusting (C) unwilling; (C) God's calling: no turning back. (D) faith. Crystal cutting off his family is a plan of God. </li></ol>",
