            "6": "",
            "7": "",
            "8": "<ol><li>Job in hand of Satan.</li></ol>",
            "9": "<ol><li>God always with us. but we are not always with God. </li><li>\"因为常有穷人和你们同在．只是你们不常有我。\" (Jhn12:8, Mat26:11) </li></ol>",
            "10": "<ol><li>An false old golden rule in OT: personal sin always leads to tribulation  (punishments)</li><li>Eliphaz:Job has infliction, he must be sinned. </li><li>Job: break the golden rule. Sin usually leads to judgement but not always. </li><li>Job is innocent. Jesus is righteous. Scapegoat. </li><li>\"\"Neither this man nor his parents sinned,\" said Jesus, \"but this happened so that the work of God might be displayed in his life.\" (Jhn9:3 NIV)</li></ol><div>Sure: pain === Satan.</div><div><div><br></div></div><div><div>Puzzles: Why John was beheaded?</div><div>Paul was beheaded, with sting. </div><div>12 apostles short life expect John.</div><div><div><div>他诚然担当我们的忧患、背负我们的痛苦．我们却以为他受责罚、被　神击打苦待了。\" (Isa53:4 CUVS) </div><div><br></div></div><div><br></div></div></div><div><div>\"凡恒心行善、寻求 荣耀 尊贵、和不能朽坏之  [福]  的、就以永生报应他们．\" (Rom2:7 CUVS) </div><div>\"你要为真道打那美好的仗、持定 永生．你为此被召．也在许多见证人面前、已经作了那美好的见证。\" (1Ti6:12 CUVS) </div><div><div>\"我的弟兄们、你们落在百般试炼中、都要以为大喜乐．\" (Jas1:2 CUVS) </div></div></div><div><div><br></div><div><div>那杀身体不能杀灵魂的、不要怕他们．惟有能把身体和灵魂都灭在地狱里的、正要怕他。\" (Mat10:28 CUVS) </div><div><br></div></div></div><div><br></div><div>Attitude of tribulation toward</div><div>II. others: comfort people / brothers/sisters in bitterness.</div><div><br></div><div><br></div><div>III. self:  glorify Jesus in bitterness in front of pagans.</div><div><div>\"我们劳苦努力、正是为此．因我们的指望在乎永生的　神．他是万人的救主、更是信徒的救主。\" (1Ti4:10 CUVS) </div><div><br></div></div><div><br></div><div>IV. God. </div><div><br></div><div><div>\"不叫我们遇见试探．救我们脱离凶恶。〔或作脱离恶者〕因为国度、权柄、荣耀、全是你的直到永远、阿们。〔有古卷无因为至阿们等字〕\" (Mat6:13 CUVS) </div><div>\"我们日用的饮食、今日赐给我们。\" (Mat6:11 CUVS) </div></div><div><br></div><div><br></div>",
