            "5": "<ol><li>Jesus concluded that the end of law is to love(<span style=\"color: rgb(1, 16, 58); font-family: blbGentium; font-size: 18.72px; background-color: rgb(248, 248, 218);\">ἀγάπη)</span> God and neigbhor. </li><li>Paul further consolided it as the love (agape, <span style=\"color: rgb(1, 16, 58); font-family: blbGentium; font-size: 18.72px; background-color: rgb(248, 248, 218);\">ἀγάπη</span>) </li></ol>",
            "6": "",
            "7": "",
            "8": "<h1>What is the law(νόμος) in the Bible</h1><div><a>νόμος (nomors): </a><br><a style=\"font-size: 20px;\">anything established, anything received by usage, a custom, a law, a command of any law whatsoever a law or rule producing a state approved of God by the observance of which is approved of God a precept or injunction the rule of action prescribed by reason of the Mosaic law, and referring, acc. to the context. either to the volume of the law or to its contents the Christian religion: the law demanding faith, the moral instruction given by Christ, esp. the precept concerning love the name of the more important part (the Pentateuch), is put for the entire collection of the sacred books of the OT</a><ol><li>The Ten Commandments (Exodus 20)</li><li>Mosaic Law (613 mitzvot from 5books, Talmud)</li><li>Torah (5 Books, The Pentateuch)</li><li>\"because Abraham obeyed my voice话(קוֹל) and kept my charge吩咐(מִשְׁמֶרֶת), my commandments命令(מִצְוָה), my statutes律例(חֻקָּה), and my laws法度(תּוֹרָה).\" (Gen26:5 ESV) \"都因亚伯拉罕听从我的话、遵守我的吩咐、和我的命令、律例、法度。\" (Gen26:5 CUVS) <br> </li><li>OT.  Jesus answered them, is it not written in your law, ‘I said, you are gods’?(Jhn10:34) Jesus quots���Psa82:6.  1Cor 14:21: In the law it is written, ‘By men of strange tongues and by lips of foreigners will I speak to this people; and even then they will not listen to me, says the Lord’. Paul was quoting from Isaiah 28:11-12.</li><li>NT: the instruction given by Christ.</li><li>Law = The Bible = the Word of God(Biblical) = the Logos (Christology) = the Will of God (Plan). \"All Scripture is God-breathed and is useful for teaching, rebuking, correcting and training in righteousness,\" (2Ti3:16 NIV).   \"彼得和众使徒回答说、顺从　神、不顺从人、是应当的。\" (Act5:29 CUVS) \"But Peter and the apostles answered, \"We must obey God rather than people.\" (Act5:29 NHEB_yhwh) <br> </li></ol><h1>What is not the law in the Bible?</h1><ol><li>differs to the social/civil/religious legitimacy/juridical/legal rule/constitution/statute/bill/regulation/decree/act/order,</li><li>or scientific principle/axiom,</li><li>though they all based on the biblical Law. </li><li>essential difference is that bible Law came from the Lord, human laws came from man through dictator power or democrat voting or science/tech protocols. </li><li>biblical laws are not the results of the evolution of human experiences.</li></ol><h1>What is good for the law?</h1><ol><li>1Ti1:5 the end of law is love.</li><li>For God. Gen1:3-2:1 shows that the world is created by the LaW. God saw it good.  (Without Law(Word), then is Gen1:2a)</li><li>For man, not harmful.  can know God through law,  use law to glory God, use law for missionary.</li><li>Essence: \"for before the law was given, sin was in the world. But sin is not taken into account when there is no law.没有律法之先、罪已经在世上．但没有律法、罪也不算罪\" (Rom5:13 NIV)<br>\"因为罪的工价乃是死．惟有　神的恩赐、在我们的主基督耶稣里、乃是永生。\" (Rom6:23 CUVS) <br>Sinner know sin, limitation, the reason of death.  (comfort zone)<br>Sinner to allow to repent to turn back to obedience, thanksgive the grace of God, </li><li>Suffering, \"因为律法是惹动忿怒的〔或作叫人受刑的〕那里没有律法、那里就没有过犯\" (Rom4:15 CUVS)<br>This is main reason many don't like law. obey law get nothing but disobey get punished.<br>Daoism/Buddhism said that the desire is the reason of suffering. Teaching no desire(无欲->无为无知无争无求). 恬淡虚无，真气从之，精神内守，病安从来[黄帝内经]<br>Spritual Suicide.<br>The desire disobey the law is the reason to cause suffering. <br>We should have desire. If no desire, we inspire people. <div>\"就如经上所记、『没有义人、连一个也没有．\" (Rom3:10 CUVS) <br>\"没有明白的、没有寻求　神的. no one understands; no one seeks for God.\" (Rom3:11 CUVS) <br>\"都是偏离正路、一同变为无用．没有行善的、连一个也没有。\" (Rom3:12 CUVS) </div></li><li>Quantity: \"The law was added so that the trespass might increase. But where sin increased, grace increased all the more,\" \"律法本是外添的、叫过犯显多．只是罪在那里显多、恩典就更显多了。\" (Rom5:20 CUVS) (Rom5:20 NIV)</li><li>Uniqueness: \"就如经上所记、『没有义人、连一个也没有．\" (Rom3:10 CUVS) Since Adam, to present to future (absolute just). Only Jesus is absolote perfect. <br>salvor. to know the precious salvation of Jesus. Democrate/freedom/tolerance secular said: possibly many ways to go to heavens.  </li><li>Prepared for Him: \"莫想我来要废掉律法和先知．我来不是要废掉、乃是要成全。Jesus came, not to obsolete the Law but fulfill the Law. \" (Mat5:17 CUVS) <br>Only the Son of God can say and do this.<br>We cannot obey the law, but In Him, by love, through faith, we can be called the righteous. </li><li>Ritual is not totally bad, as long as it can glory the God to express the love of Jesus, we can abey it. </li><li>But inner love of Jesus, not pretend to be the liars.</li><li>to show the holiness of God, the right of Jesus, the power of Gospel. </li><li>\"The law of the Lord is perfect, reviving the soul. The statutes of the Lord are trustworthy, making wise the simple.\" (Psm19:7 NIV)<br>\"惟喜爱耶和华的律法、昼夜思想、这人便为有福.\" (Psm1:2 CUVS) Not to obey but love. </li></ol><h1>What is the proper use(用得合宜) of the law?</h1><ol><li>primarily use it for self-exame of sin. (1Ti1:9)<br>谁能知道自己的错失呢．愿你赦免我隐而未现的过错\"Who can discern his errors? Forgive me from hidden errors.\" (Psm19:12 NHEB_yhwh) <div>求你拦阻仆人、不犯任意妄为的罪．不容这罪辖制我．我便完全、免犯大罪 \"Keep back your servant also from presumptuous sins. Let them not have dominion over me. Then I will be upright. I will be blameless and innocent of great transgression.\" (Psm19:13 NHEB_yhwh) </div></li><li>Prayer to petition on forgiving our debts (Jesus' prayer Mat6:15)</li><li>thanksgiving to Jesus: </li><li>Not for judging others.</li><li>Not for proclaiming in public self-justification/santification,</li><li>Not for self-glorification, personal-benifit (ig. ad)</li><li>Not for seeking excuses/breach. </li><li> </li></ol></div>",
