            "7": "",
            "8": "<div><div><div> </div></div>Paul's Family View (Character of 1Tim):</div><ol><li>人若不知道管理自己的家、焉能照管　神的教会呢 (1Ti3:5 CUVS) </li><li>Family is important for each person's life.</li></ol><div><div>Western (Greek mythology神话gods are familial.  modern familial relationship is determined by legal priority):</div><ol><li>spouse </li><li>children, </li><li>parents</li><li>siblings. </li><li>others</li></ol><div> Chinese Family View is obsure:</div><div><ol><li>任人唯亲Cronyism, 家族 统治/势力. family power. 家里家外Clear boundary between inside and outside home.</li><li>六親不認 (形容不重天倫，不通人情，對親屬都不顧), 大义灭亲(左传)<br />六親: <br />左傳: 父子、兄弟、姑姐（父親的姐妹）、甥舅、婚媾（妻的家屬）及姻亞（夫的家屬）。<br />老子: 以父子、兄弟、夫婦為六親。<br />漢書: 以父、母、兄、弟、妻、子為六親。</li></ol></div></div><div>Jesus' Family View (lit Diff to Paul):</div><ol><li>Mat19:29. Mak10:29.  Luk18:29. (common 29)凡为我的名撇下房屋、或是弟兄、姐妹、父亲、母亲、〔有古卷添妻子〕儿女、田地的、必要得着百倍、并且承受永生。\" (Mat19:29 CUVS) </li><li>Jesus's father view:  耶稣说、为甚么找我呢．岂不知我应当以我父的事为念么。〔或作岂不知我应当在我父的家里么? And he said to them, \"Why were you looking for me? Did you not know that I must be in my Father's house?\" (Luk2:49 ESV) </li><li>Jesus’ family view: Mat12:50, Mak3:35, Luk8:21. 他却回答那人说、谁是我的母亲．谁是我的弟兄。\"就伸手指着门徒说、看哪、我的母亲、我的弟兄. 凡遵行我天父旨意的人、就是我的弟兄姐妹和母亲了。\" (Mat12:48-50 CUVS) </li><li>Mat8:22, Luk9:60. 耶稣说、任凭死人埋葬他们的死人、你跟从我吧。\" (Mat8:22 CUVS) </li><li>Jesus’ attitude to hometown: Mat13:58, Mak6:5, Jhn4:44, 耶稣因为他们不信、就在那里不多行异能了。\" (Mat13:58 CUVS) </li></ol><div><div>OT:</div><ol><li>God’s family principle: Gen2:24. </li><li>Abraham and Issac: Gen12:1. </li><li>Jos24:15. As for me and my house, we will serve the Lord.</li></ol></div><div>What is the Christian's familial view?(Theological harmony union of family and church: treat family relatives as neighbors)</div><ol><li>Jesus’ Greatest command: Mat22:37;<br />neighbor (πλησίον, play-see'-on, G4139, x19) = Luk10:29, Mat5:43 谁是我的邻舍呢?\" (Luk10:29 CUVS) ). <br />man (ἄνθρωπος Anthropos, G444, x559, Mat4:4 </li><li>Jesus’ Greatest command = Deu6:4 + Lev19:18 <br />\"不可报仇、也不可埋怨���本国的子民、却要爱人(רֵעַ ray-ah, neighbor)如己．我是耶和华。\" (Lev19:18 CUVS). Lev19:18 neighbor רֵעַ ray-ah, From pastor/sheperd <a href=\"https://www.blueletterbible.org/lexicon/h7462/kjv/wlc/0-1/\" id=\"yui-gen36\" title=\"English: feed, shepherd, pastor, herdmen, keep, companion, broken, company, devour, eat, entreateth, misc\">רָעָה (H7462)</a>. </li><li>Paul(single) married to Jesus.</li><li>Paul's son Timothy is spiritual based. 写信给那因信主作我 真儿子 的提摩太\"To Timothy, my true child in the faith:\" (1Ti1:2 ESV) </li><li>Jos24:15. As for me and my house, we will serve the Lord.</li></ol><div>Practice:</div><ol><li>Family tragedy comes from false family view; false family view comes false thinking.</li><li>Family and church are indivisible. </li><li>many issues(children raising/education, careers promotion, social skill, drug/porn addiction etc) rooted from family issue.</li></ol><div> </div><div> </div><div> </div><div> </div><div> </div>",
